import React from "react";
import {
    withScriptjs,
    withGoogleMap,
    GoogleMap,
    Marker
} from "react-google-maps";
import {useDispatch, useSelector} from "react-redux";
import {getRouteProps} from "../redux/apiMobileV2/ApiMobileV2Action";


function RouteProps() {
    const dispatch = useDispatch();
    const data = useSelector(state => state.apiMobileV2Reducer.routePropsData);
    const status = useSelector(state => state.apiMobileV2Reducer.routePropsStatus);
    React.useEffect(() => {
        dispatch(getRouteProps())
    }, []);
    console.log(data)
}


class MapBlock extends Component {
    constructor(props) {
        super(props);
        this.state = {
            clickedMarker: null
        };
    }

    static defaultProps = {
        center: {
            lat: 50.6304916,
            lng: 3.0526526
        },
        zoom: 14
    };

    render() {
        return (
            // Important! Always set the container height explicitly
            <div style={{ flex: '0 0 35rem', height: '100vh', position: 'sticky', top: '0'}}>
                <div className="" style={{ height: '100%', width: '100%', position: 'absolute', top: '0px', left: '0px' }}>
                    <GoogleMapReact
                        bootstrapURLKeys={{ key: "" }}
                        defaultCenter={this.props.center}
                        defaultZoom={this.props.zoom}
                    >
                        {this.props.meals.map(m => {
                            return (
                                <MapMarker
                                    lat={m.restaurant.latitude}
                                    lng={m.restaurant.longitude}
                                    key={m.restaurant.id}
                                    meal={m}
                                    hoveredRestaurant={this.props.hoveredRestaurant}
                                />
                            )
                        })}
                    </GoogleMapReact>
                </div>
            </div>
        );
    }
}

export default MapBloc

